import { useState, useEffect } from 'react';
import axios from 'axios';

import './App.css';

function App() {
  const [pokemon, setPokemon] = useState([])

  useEffect(() => {
    let cancel
    axios.get('https://pokeapi.co/api/v2/pokemon', {
      cancelToken: new axios.CancelToken(c => cancel = c)
    })
    .then(res => {
      setPokemon(res)
    })
  })

  return (
    <div className="App">
      {null}
    </div>
  );
}

export default App;
